import React from "react";
// import Nav from "./Nav"
import "./Footer.css";
// import whiteLong from '../../img/whiteLong.png'

const Footer = () => {
  return (
    <div className="footer">
      <div className="container">
        <div className="row text-center pt-5 pb-5">
          <div className="col-md-4 pb-5">
            <a href="mailto: Info@C-3.co">
                <button className='footer-buttons'></button>
            </a>
          </div>
          <div className="col-md-4 pb-5">
          <button className='footer-buttons'><a href="C-3.co">Visit Parent Website</a></button>
          </div>
          <input type="button" value="Put Your Text Here" onclick="window.location.href='http://www.hyperlinkcode.com/button-links.php'" />
          <div className="col-md-4 pb-5">
          <button className='footer-buttons'><a href="C-3.co">About Us</a></button>
          </div>
        </div>
      </div>
    </div>
  )
}

export default Footer;
